import React from "react";
import "../../Styles/Shared/AboutCard.scss";
import aboutCard1 from "../../Assets/aboutCard1.webp";
function AboutCard() {
  return (
    <div className='aboutCard'>
      <img src={aboutCard1} alt='' />
      <hr />
      <h3>Creativity</h3>
      <p>
        Striving to bring imagination, original ideas, and excitement to
        everything we do.
      </p>
    </div>
  );
}

export default AboutCard;
